import React from "react";
import "./Header.css"

const Header = () => {
    return (
        <nav className="nav">
            <a href="/">
                <h1>Pantry Pal</h1>
            </a>

            <ul>
                <li><p>HEllo</p></li>
                <li><p>Before</p></li>
            </ul>
        </nav>
    )
}

export default Header;
